import React, { Component } from 'react';
import moment from 'moment';


export class Home extends Component {
    constructor() {
     super();
     let today = moment().format('LL');
    this.state ={
      today: today,
    }
}
  render() {
    return (
      <div>
        <h2>{this.state.today}</h2>
      </div>
    )
  }
}

export default Home
